import styled from 'styled-components';
import React, { useState, useEffect } from 'react';
import { Link , useNavigate} from 'react-router-dom';
import parseJwt from '../modules/parseJwt';


const PersonalPage: React.FC = () => {
  const [images, setImages] = useState<any[]>([]);
  const [userName, setUserName] = useState<string>('')
  const navigate = useNavigate();
  
  const formatTime = (dateTimeString: string): string => { //날짜 형태 지정
    const options: Intl.DateTimeFormatOptions = {
      year: 'numeric',
      month: 'numeric',
      day: 'numeric',
      hour: 'numeric',
      minute: 'numeric',
      hour12: false,
    };
    

    const dateTime = new Date(dateTimeString);
    return dateTime.toLocaleString(undefined, options);
  };

  useEffect(() => {

    const Token: any = localStorage.getItem('__bluecapsule__');
    const decodedToken = parseJwt(Token);
    if(!Token){
      alert("올바른 경로로 접근하세요.")
      return navigate("/")
    }
    setUserName(decodedToken.name);

    const fetchImages = async () => {
      try{
        const response = await fetch(`${process.env.REACT_APP_API_SERVER_APP}/ShowImagePrivate`, {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
          },
        });

        if (!response.ok) {
          throw new Error('Failed to fetch images');
        }
        const data = await response.json();
        setImages(data.filter((images: any) => images.name === userName));
      } catch (error: any) {
          console.error('Error fetching images: ', error);
      }
    };
    fetchImages();
  }, [userName]);

  return (
    <>

      <Container>
        <h2>개인 페이지</h2>
        <Link to="/">
          <Button><span>메인 페이지</span></Button>
        </Link>
        <Link to="/Upload">
          <Button><span>게시물 등록</span></Button>
        </Link>
      </Container>
      <br />
      <H2>등록한 이미지</H2>
      <ImageContainer>
        {images.map((image: any, index) => (
          <ImgContainer key={index}>
            <Image src={image.img} alt='이미지 로드 오류' />
            <button>
                게시물 수정
            </button>
            <p>
              <Span>등록 일자</Span> <br />
              <strong>{formatTime(image.day)}</strong>
            </p>
            <label>
              공개 여부 : <strong>{image.visible}</strong>
            </label>
          </ImgContainer>
          ))}
      </ImageContainer>
      <Container>

      </Container>
    </>
  );
}

export default PersonalPage;

const H2 = styled.h2`
  text-align: center;
`;

const Image = styled.img`
    width: 150px;
    height: 150px;
    border-radius:5px;
    object-fit: cover;
    margin: 5px;
`;
const Span = styled.span`
  font-size:15px;
  color: rgba(125, 125, 125, 1);
`;
const Container = styled.div`
    display: grid;
    justify-content: center;
    text-align:center;
`;
const ImgContainer = styled.div`
  text-align: center;
  width:200px;
  height:300px;
`;
const ImageContainer = styled.div`
  display: flex;
  flex-wrap: wrap;
`;
const button = styled.button `
  border: none;
`;

const Button = styled.button`
  margin: auto;
  margin-top: 20px;
  background: rgb(0, 172, 238);
  background: linear-gradient(0deg, rgba(0, 172, 0, 1) 0%, rgba(2, 126, 0, 1) 100%);
  width: 200px;
  height: 40px;
  line-height: 42px;
  padding: 0;
  border: none;
  border-radius: 5px;
  position: relative;
  color: white;
  outline: none;
  box-shadow: inset 2px 2px 2px 0px rgba(255, 255, 255, 0.5),
    7px 7px 20px 0px rgba(0, 0, 0, 0.1),
    4px 4px 5px 0px rgba(0, 0, 0, 0.1);
  transition: all 0.3s ease;

  &:before,
  &:after {
    content: "";
    position: absolute;
    right: 0;
    top: 0;
    background: rgba(2, 126, 0, 1);
    transition: all 0.3s ease;
  }

  &:before {
    height: 0%;
    width: 2px;
  }

  &:after {
    width: 0%;
    height: 2px;
  }

  &:hover {
    background: transparent;
    box-shadow: none;

    &:before {
      height: 100%;
    }

    &:after {
      width: 100%;
    }

    span {
      color: rgba(2, 126, 0, 1);

      &:before {
        height: 100%;
      }

      &:after {
        width: 100%;
      }
    }
  }

  span {
    position: relative;
    display: block;
    width: 100%;
    height: 100%;

    &:before,
    &:after {
      content: "";
      position: absolute;
      left: 0;
      bottom: 0;
      background: rgba(2, 126, 0, 1);
      transition: all 0.3s ease;
    }

    &:before {
      width: 2px;
      height: 0%;
    }

    &:after {
      width: 0%;
      height: 2px;
    }
  }
`;
